import styled from "styled-components";
import { CouponItem } from "./Item";

export const CouponList = () => {
    return (
        <StyledContainer>
            <CouponItem />
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    width: 88%;
    margin: 0 auto;
    padding: 25px 0;
`;
